CREATE TABLE "ANALOG_BJT"
(
    "ID" SERIAL PRIMARY KEY,
    "Product (WPN)" VARCHAR(512),
    "Datasheet" VARCHAR(512),
    "OPN" VARCHAR(512),
    "Price" FLOAT,
    "Description" VARCHAR(512),
    "IC Continuous (A)" FLOAT,
    "VCEO Min (V)" INT,
    "hFE Min" FLOAT,
    "fT Min (MHz)" FLOAT,
    "PTM Max (W)" FLOAT,
    "VEBO (V)" FLOAT,
    "Mounting Type" VARCHAR(512),
    "Configuration" VARCHAR(512),
    "Polarity" VARCHAR(512),
    "Type of General purpose BJT" VARCHAR(512),
    "Package Type" VARCHAR(512),
    "Analog Transistor Group" VARCHAR(512),
    "VBE(sat) (V)" FLOAT,
    "VBE(on) (V)" FLOAT,
    "VCE(sat) Max (V)" FLOAT,
    "VCBO (V)" INT,
    "hFE Max" FLOAT,
    "Qualification" VARCHAR(512),
    "AEC Qualified" BOOLEAN,
    "PPAP Capable" BOOLEAN,
    "Halide Free" BOOLEAN,
    "Lead Free" BOOLEAN,
    "Status" VARCHAR(512)
);


